import React from "react";
import { Layout, Menu, Breadcrumb, Icon } from 'antd';
import { BrowserRouter, Route, Redirect } from 'react-router-dom';
import Catalog from './views/Catalog';
import Dataset from './views/Dataset';
import Viz from './views/Viz';
import COMMONS from './commons';
import './App.css';
const { Header, Content, Footer, Sider } = Layout;
const SubMenu = Menu.SubMenu;

class App extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            collapsed: false,
            catalog: {
                page: '1',
                sortOrder: 'DESC',
                sortBy: 'created',
                query: '',
                itemsPerPage: '20',
                url: COMMONS.api.catalog,
                data: [],
                metadata: {
                    'Total-Number-Of-Catalog': 0
                },
                fetching: true
            },
            dataset: {
                url: null,
                page: 1
            },
            viz: {
                url: null,
                title: null
            }
        };
    }

    /* 
    * Function: builds the correct catalog url
    * Returns: String
    */
    getCatalogUrl = function (page = this.state.catalog.page) {
        return `${this.state.catalog.url}?query=${this.state.catalog.query}&sort_by=${this.state.catalog.sortBy}&sort_order=${this.state.catalog.sortOrder}&items_per_page=${this.state.catalog.itemsPerPage}&page=${page - 1}`;
    }

    /* 
    * Function: handles the pagination logic in the catalogs page
    * Returns: nothing
    */
    handleCatalogUrlPagination = function (page, pageSize) {
        this.fetchCatalogs(page);
    }

    /*
    * Function: Switches the view to Dataset
    * Returns: Nothing
    */
    handleDatasetViewSwitch = function (url, history) {
        let newDataset = { ...this.state.dataset, url: url };
        this.setState({
            dataset: newDataset
        })
        history.push('/Dataset');
    }

    /*
    * Function: Switches the view to Viz
    * Returns: nothing
    */
    handleVizViewSwitch = function (url, history, page, title) {
        let newDataset = {...this.state.dataset, page: page};
        let newViz = {...this.state.viz, url: url, title: title}
        this.setState({
            dataset: newDataset,
            viz: newViz
        })
        history.push('/Viz')
    }

    onCollapse = (collapsed) => {
        this.setState({ collapsed });
    }

    fetchCatalogs = function (page) {

        let newCatalog = { ...this.state.catalog, fetching: true };
        this.setState({
            catalog: newCatalog
        })

        fetch(this.getCatalogUrl(page))
            .then((response) => { return response.json() })
            .then((result) => {
                console.log(result);
                let metadata = result.shift();
                console.log(metadata)
                let newCatalog = { ...this.state.catalog, data: result, metadata: metadata, page: page, fetching: false };
                this.setState({
                    catalog: newCatalog
                })
            });
    }

    render() {
        return (
            <BrowserRouter>
                <Layout style={{ minHeight: '100vh' }}>
                    <Sider
                        width={200}
                        collapsible
                        collapsed={this.state.collapsed}
                        onCollapse={this.onCollapse}
                    >
                        <div className="logo" >
                            <div className="widget"><a href="https://data.gov.in/catalogs"><img src="data:image/png;base64," /></a></div>
                        </div>
                        <Menu theme="dark" mode="inline">


                        </Menu>
                    </Sider>
                    <Route path='/'
                        exact
                        render={(routeProps) => (
                            <Catalog {...routeProps}
                                page={this.state.catalog.page}
                                data={this.state.catalog.data}
                                metadata={this.state.catalog.metadata}
                                onPageChange={(page, pageSize) => { this.handleCatalogUrlPagination(page, pageSize) }}
                                onDatasetViewSwitch={(url, history) => { this.handleDatasetViewSwitch(url, history) }}
                                fetching={this.state.catalog.fetching}
                                onInit={() => { this.fetchCatalogs(this.state.catalog.page) }}
                            />
                        )}
                    />

                    <Route path='/dataset'
                        exact
                        render={(routeProps) => (
                            this.state.dataset.url ?
                            <Dataset {...routeProps}
                                data={this.state.dataset}
                                onVizViewSwitch={ (url, history, page, title) => { this.handleVizViewSwitch(url, history, page, title) }}
                            /> : 
                            <Redirect to="/"/>
                        )}
                    />

                    <Route path='/viz'
                        exact
                        render={(routeProps) => (
                            this.state.viz.url ?
                            <Viz {...routeProps}
                                data={this.state.viz}
                            /> :
                            <Redirect to="/"/>
                        )}
                    />
                </Layout>
            </BrowserRouter>
        );
    }
}

export default App;